REFERENCES tm_usuario(codigo_usuario)
GO
--
ALTER TABLE tm_tarea ADD CONSTRAINT tm_tarea_tm_proyecto FOREIGN KEY(codigo_proyecto)
REFERENCES tm_proyecto(codigo_proyecto)
